import React from 'react';

const Blog = () => {
    return (
        <div class="bg-gray-100">
            <div class="mx-auto max-w-7xl px-4 sm:px-6 lg:px-8">
                <div>
                    <h2 class="text-3xl font-bold text-gray-900 mr-96 mx-96">Featured Blogs</h2>
                    <div class="mt-6 space-y-12 lg:grid lg:grid-cols-3 lg:gap-x-6 lg:space-y-0">
                        <div class="group relative">
                            <div class="relative h-full w-full overflow-hidden rounded-lg bg-white sm:aspect-h-1 sm:aspect-w-2 lg:aspect-h-1 lg:aspect-w-1  sm:h-96">
                                <div>
                                    <img src="https://www.ahst.co.uk/wp-content/uploads/2016/07/600x400.png" alt="Desk with leather desk pad, walnut desk organizer, wireless keyboard and mouse, and porcelain mug." class="h-full w-full object-cover object-center" />
                                    <p>Blog Post Title</p>
                                    <p>This is a short excerpt from the blog post content to give readers a teaser...</p>
                                    <label>Read More</label></div>
                            </div>
                        </div>
                    </div>       
                </div>
            </div>
        </div>
    );
};

export default Blog;
